import React from "react";
const axios = require("axios").default;
const MySite = (props) => {
  const deletePostOnClick = async (id) => {
    try {
      axios
        .delete("http://localhost:3002/post/", {
          data: { id: id },
        })
        .then((response) => props.sendGetRequest());
    } catch (error) {
      console.log(error);
    }

    console.log(id);
  };

  return (
    <div>
      <h2>posts Collection</h2>
      {props.show.length < 1 ? (
        <p>There is no post yet</p>
      ) : (
        props.show.map((post, index) => <h2 key={index}>{post.title}</h2>)
     ) }

    </div>
  );
};

export default MySite;
